Movie Info: Sahasam (English:Bravery) is a 2013 Telugu adventure film directed by Chandra Sekhar Yeleti and produced by BVSN Prasad under Sri Venkateswara Cine Chitra starring Gopichand and Taapsee Pannu, who share the screen for the second time after the 2011 film Mogudu. The film marks the second time Gopichand and Chandra Sekhar Yeleti have worked together after Okkadunnadu.The film was known under the working title Jackpot but was later renamed as Sahasam. The film, mostly shot in Ladakh, and Hyderabad,.The film's first look was released on the eve of Ugadi i.e. April 11, 2013.

Credits - Jaffa


